import React, { Component } from 'react'

export default class App extends Component {
    render() {
        return (
            <div className='bg'>
                <div className='top'>
                    <div className='title'>知行后台登陆系统</div>
                    <div className='content'></div>
                </div>
            </div>
        )
    }
}
